search = ["sql", "rdf", "xml", "nosql", "machine learning", "hadoop", "internet of things", "data science", "blockchain"]

counts = {}
for term in search:
    temp = df_papers.filter("plaintext like '% " + term + " %'").groupBy('year').count()
    counts[term.replace(' ', '_')] = map(lambda row: row.asDict(), temp.collect())

%pyspark
sorted_by_year = {}
for key, value in counts.items():
    sorted_by_year[key] = sorted(value, key=lambda x: int(x['year']))
